Model 1 focuses on a fairness estimate derived from the ratio of tokens earned and incorporates loss aversion. Model 2 simplifies this by considering the difference between the offered split and the monetary value of the participant's tokens.

A potential limitation of both models is that they don't explicitly account for the opponent's proposed split. It's possible that the responder's utility isn't solely based on what they receive, but also on what the opponent receives. This could reflect concerns about relative payoff or inequality aversion.

Therefore, I propose a model that incorporates the opponent's split, with a parameter to modulate the importance of the split difference. It leverages the insight of loss aversion to model fairness.

<MODEL>
